css:
body {
  font-size: 13px;
  color: #899ba6;
  background-color: #3c4c55;
}
atom-pane {
  border-right: 1px solid #556873;
}
atom-pane:last-child {
  border-right: none;
}
.btn {
  color: #9aaab3;
  background-color: #556873;
}
.btn:hover,
.btn:focus {
  color: #7fc1ca;
  background-color: #7fc1ca;
}
.btn:active {
  color: rgba(127, 193, 202, 0.66);
  background-color: #51636d;
}
.btn.selected {
  color: #7fc1ca;
  background-color: #7fc1ca;
}
.btn:focus,
.btn:focus:active {
  outline: none;
}
.btn.btn-primary {
  color: #7fc1ca;
  background-color: #7fc1ca;
}
.btn.btn-primary:hover,
.btn.btn-primary:focus {
  background-color: #8dc8d0;
}
.btn.btn-primary:active {
  background-color: #71bac4;
}
.btn.btn-primary.selected {
  background-color: #8dc8d0;
}
.btn.btn-primary.selected:focus,
.btn.btn-primary.selected:hover {
  background-color: #9ccfd6;
}
.btn.btn-info {
  color: #7fc1ca;
  background-color: #7fc1ca;
}
.btn.btn-info:hover,
.btn.btn-info:focus {
  background-color: #8dc8d0;
}
.btn.btn-info:active {
  background-color: #71bac4;
}
.btn.btn-info.selected {
  background-color: #8dc8d0;
}
.btn.btn-info.selected:focus,
.btn.btn-info.selected:hover {
  background-color: #9ccfd6;
}
.btn.btn-success {
  color: #7fc1ca;
  background-color: #7fc1ca;
}
.btn.btn-success:hover,
.btn.btn-success:focus {
  background-color: #8dc8d0;
}
.btn.btn-success:active {
  background-color: #71bac4;
}
.btn.btn-success.selected {
  background-color: #8dc8d0;
}
.btn.btn-success.selected:focus,
.btn.btn-success.selected:hover {
  background-color: #9ccfd6;
}
.btn.btn-warning {
  color: #7fc1ca;
  background-color: #df8c8c;
}
.btn.btn-warning:hover,
.btn.btn-warning:focus {
  background-color: #e39c9c;
}
.btn.btn-warning:active {
  background-color: #db7c7c;
}
.btn.btn-warning.selected {
  background-color: #e39c9c;
}
.btn.btn-warning.selected:focus,
.btn.btn-warning.selected:hover {
  background-color: #e8acac;
}
.btn.btn-error {
  color: #7fc1ca;
  background-color: #df8c8c;
}
.btn.btn-error:hover,
.btn.btn-error:focus {
  background-color: #e39c9c;
}
.btn.btn-error:active {
  background-color: #db7c7c;
}
.btn.btn-error.selected {
  background-color: #e39c9c;
}
.btn.btn-error.selected:focus,
.btn.btn-error.selected:hover {
  background-color: #e8acac;
}
.btn-group > .btn {
  border-color: rgba(0, 0, 0, 0.2);
}
atom-text-editor[mini] {
  padding-left: 5px;
  color: #899ba6;
  border-radius: 2px;
  background-color: #556873;
}
atom-text-editor[mini].is-focused {
  background-color: #4a5b64;
}
atom-text-editor[mini] .placeholder-text,
atom-text-editor[mini]::shadow .placeholder-text {
  color: #6a7d89;
}
atom-text-editor[mini] .selection .region,
atom-text-editor[mini]::shadow .selection .region {
  background-color: transparent;
}
.find-and-replace {
  border-top: 1px solid #556873;
}
.status {
  color: #899ba6;
}
.status-added {
  color: #7fc1ca;
}
.status-ignored {
  color: #6a7d89;
}
.status-modified {
  color: #df8c8c;
}
.status-removed {
  color: #df8c8c;
}
.status-renamed {
  color: #7fc1ca;
}
.key-binding {
  display: inline-block;
  margin-left: 1px;
  padding: 0 5px;
  line-height: 2;
  font-family: 'Helvetica Neue', Arial, sans-serif;
  font-size: .8em;
  letter-spacing: 1px;
  border-radius: 2px;
  background-color: #3c4c55;
}
.list-group li {
  padding-left: 5px;
}
.list-group li.selected {
  color: #7fc1ca;
  background-color: transparent;
}
.list-group li.selected:before {
  display: none;
}
.list-tree .selected {
  color: #7fc1ca;
}
.select-list li {
  padding: 5px 10px;
}
.select-list .status {
  float: right;
}
.select-list.popover-list {
  padding: 5px;
  border-radius: 2px;
  background-color: #556873;
  box-shadow: 0 2px 8px 1px rgba(0, 0, 0, 0.3);
}
.select-list.popover-list .list-group {
  margin-top: 5px;
}
.select-list.popover-list .list-group li {
  padding-left: 5px;
}
.panel-heading {
  border-bottom: 1px solid #6a7d89;
  background-color: #556873;
}
.inset-panel {
  background-color: #556873;
}
.inset-panel .panel-heading {
  background-color: #5e737f;
}
atom-panel.modal {
  border: 1px solid #6a7d89;
  border-top: none;
  box-shadow: 0 2px 8px 1px rgba(0, 0, 0, 0.3);
}
.loading-spinner-large {
  display: block;
  width: 64px;
  height: 64px;
  background-image: url(images/octocat-spinner-128.gif);
  background-repeat: no-repeat;
  background-size: 64px 64px;
}
.loading-spinner-large.inline-block {
  display: inline-block;
}
.loading-spinner-medium {
  display: block;
  width: 48px;
  height: 48px;
  background-image: url(images/octocat-spinner-128.gif);
  background-repeat: no-repeat;
  background-size: 48px 48px;
}
.loading-spinner-medium.inline-block {
  display: inline-block;
}
.loading-spinner-small {
  display: block;
  width: 32px;
  height: 32px;
  background-image: url(images/octocat-spinner-128.gif);
  background-repeat: no-repeat;
  background-size: 32px 32px;
}
.loading-spinner-small.inline-block {
  display: inline-block;
}
.loading-spinner-tiny {
  display: block;
  width: 16px;
  height: 16px;
  background-image: url(images/octocat-spinner-128.gif);
  background-repeat: no-repeat;
  background-size: 16px 16px;
}
.loading-spinner-tiny.inline-block {
  display: inline-block;
}
.ui-site-1 {
  background-color: #a8ce93;
}
.ui-site-2 {
  background-color: #83afe5;
}
.ui-site-3 {
  background-color: #f2c38f;
}
.ui-site-4 {
  background-color: #9a93e1;
}
.ui-site-5 {
  background-color: #dada93;
}
.status-bar {
  font-size: 13px;
  color: #899ba6;
  border-top: 1px solid #556873;
  background-color: #3c4c55;
}
.tab-bar {
  background-color: #556873;
  border-bottom: 1px solid #556873;
}
.tab-bar .tab {
  color: #899ba6;
  height: 30px;
  line-height: 30px;
  font-size: 13px;
  border-right: 1px solid #3c4c55;
  background-color: #556873;
}
.tab-bar .tab.active {
  color: #7fc1ca;
  background-color: #3c4c55;
}
.tab-bar .tab.modified:not(:hover) .close-icon {
  top: 50%;
  right: 14px;
  margin-top: -3px;
  border-color: #7fc1ca;
}
.tab-bar .tab.modified:hover .close-icon {
  color: currentColor;
}
.tab-bar .tab .close-icon:hover {
  color: #7fc1ca;
}
.tab-bar .tab.active .close-icon:hover {
  color: #899ba6;
}
.tab-bar .tab.is-dragging {
  background: #3f4d56;
  border-color: transparent;
  opacity: .5;
}
.tab-bar .tab.is-dragging .close-icon {
  visibility: hidden;
}
.text-smaller {
  font-size: smaller;
}
.text-subtle {
  color: #6a7d89;
}
.text-highlight {
  color: #7fc1ca;
}
.text-info {
  color: #7fc1ca;
}
.text-success {
  color: #7fc1ca;
}
.text-warning {
  color: #df8c8c;
}
.text-error {
  color: #df8c8c;
}
.highlight {
  padding: 1px 4px;
  color: #7fc1ca;
  border-radius: 2px;
  background-color: transparent;
}
.highlight-info {
  padding: 1px 4px;
  color: #7fc1ca;
  border-radius: 2px;
  background-color: #7fc1ca;
}
.highlight-warning {
  padding: 1px 4px;
  color: #7fc1ca;
  border-radius: 2px;
  background-color: #df8c8c;
}
.highlight-error {
  padding: 1px 4px;
  color: #7fc1ca;
  border-radius: 2px;
  background-color: #df8c8c;
}
.highlight-success {
  padding: 1px 4px;
  color: #7fc1ca;
  border-radius: 2px;
  background-color: #7fc1ca;
}
.background-message {
  font-weight: bold;
  color: #6a7d89;
}
.tooltip .tooltip-inner {
  line-height: 1;
  padding: .75em;
  white-space: nowrap;
  max-width: none;
}
.tooltip .keystroke {
  padding: .15em .4em;
  margin: 0 -0.3em 0 0.25em;
  border-radius: 2px;
  color: #7fc1ca;
  background: transparent;
}
.tree-view-resizer {
  border-right: 1px solid #556873;
}
.tree-view {
  color: #899ba6;
  background-color: #3c4c55;
}
.tree-view .list-item.selected {
  color: #7fc1ca;
}
.status-added {
  color: #94b679;
}
.status-modified {
  color: #e9c062;
}
.status-removed {
  color: #9b4444;
}
.status-renamed {
  color: #5786b8;
}
.tab-bar {
  border-bottom: 1px solid #3c4c55;
}
.tab-bar .tab {
  color: #3c4c55;
  border-right: 0;
}
.tab-bar .tab.modified {
  color: #df8c8c;
}
.tab-bar .tab .close-icon {
  border-color: #df8c8c !important;
}
.file .status-added,
.directory .status-added,
.file .status-modified,
.directory .status-modified {
  padding-left: 15px !important;
}
.file .status-added:not(.selected),
.directory .status-added:not(.selected),
.file .status-modified:not(.selected),
.directory .status-modified:not(.selected) {
  color: inherit;
}
.file .status-added,
.directory .status-added {
  border-left: 2px solid #94b679;
}
.file .status-modified,
.directory .status-modified {
  border-left: 2px solid #e9c062;
}
.tree-view:focus li.list-item.selected {
  position: static;
}
.tree-view:focus li.list-item.selected::before {
  position: relative;
  z-index: 100;
  color: #3c4c55;
}
.tree-view:focus li.list-item.selected::after {
  position: absolute;
  content: '';
  background-color: #7fc1ca;
  width: 100%;
  height: 20px;
  left: 0;
  color: #3c4c55;
  z-index: 0;
}
.tree-view:focus li.list-item.selected > .name {
  position: relative;
  z-index: 100;
  color: #3c4c55;
}
.tree-view:focus li.list-item.selected > .name::before {
  position: relative;
  z-index: 100;
  color: #3c4c55;
}
.list-tree:focus li.directory.selected > .list-item {
  position: static;
}
.list-tree:focus li.directory.selected > .list-item::before {
  position: relative;
  z-index: 100;
  color: #3c4c55;
}
.list-tree:focus li.directory.selected > .list-item::after {
  position: absolute;
  content: '';
  background-color: #7fc1ca;
  width: 100%;
  height: 20px;
  left: 0;
  color: #3c4c55;
  z-index: 0;
}
.list-tree:focus li.directory.selected > .list-item > .name {
  position: relative;
  z-index: 100;
  color: #3c4c55;
}
.list-tree:focus li.directory.selected > .list-item > .name::before {
  position: relative;
  z-index: 100;
  color: #3c4c55;
}
.package-updates-status-view.text-info {
  color: #df8c8c;
}
.settings-view .package-card a.package-name,
.settings-view .link {
  color: #d18ec2;
}
.settings-view .package-card a.package-name:hover,
.settings-view .link:hover,
.settings-view .package-card a.package-name:active,
.settings-view .link:active,
.settings-view .package-card a.package-name:focus,
.settings-view .link:focus {
  color: #d18ec2;
}
.section-heading,
.sub-section-heading {
  color: #c5d4dd !important;
}
.btn:hover,
.btn:focus,
.btn:active {
  color: #3c4c55;
  background-color: #7fc1ca;
}
.btn:hover > .text-success,
.btn:focus > .text-success,
.btn:active > .text-success {
  color: #3c4c55;
}
.btn.selected,
.btn.btn-primary,
.btn.btn-info,
.btn.btn-success,
.btn.btn-warning,
.btn.btn-error {
  color: #3c4c55 !important;
}
.btn.selected > .text-success,
.btn.btn-primary > .text-success,
.btn.btn-info > .text-success,
.btn.btn-success > .text-success,
.btn.btn-warning > .text-success,
.btn.btn-error > .text-success {
  color: #3c4c55;
}
.badge.badge-info,
.badge.badge-success,
.badge.badge-warning,
.badge.badge-error {
  color: #3c4c55 !important;
}
.highlight-info,
.highlight-success,
.highlight-warning,
.highlight-error {
  color: #3c4c55;
}
atom-text-editor[mini]::shadow .selection .region {
  background-color: #1e272c;
  margin-top: 2px;
}
.package-card {
  background: #3c4c55 !important;
}
.scrollbars-visible-always /deep/ ::-webkit-scrollbar {
  width: 8px;
  height: 8px;
}
.scrollbars-visible-always /deep/ ::-webkit-scrollbar-track,
.scrollbars-visible-always /deep/ ::-webkit-scrollbar-corner {
  background: #6a7d89;
}
.scrollbars-visible-always /deep/ ::-webkit-scrollbar-thumb,
.scrollbars-visible-always /deep/ ::-webkit-scrollbar-thumb:hover {
  background: #7fc1ca;
  border-radius: 5px;
  box-shadow: 0;
}
.tree-view .icon:before,
.tab .title:before {
  color: inherit !important;
}
